// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.14;

/// @title GoingUP Platform Projects Smart Contract
/// @author Mark Ibanez
contract GoingUpProjects {
    struct Project {
        uint256 id;
        string name;
        string description;
        uint started;
        uint ended;
        string primaryUrl;
        string[] tags;
        address owner;
        address[] members;
        bool active;
    }

    constructor () {
        admins[msg.sender] = true;
    }

    uint256 private idCounter = 1;

    mapping(address => bool) public admins;
    modifier onlyAdmin {
        require(admins[msg.sender], "not admin");
        _;
    }


    uint256 public price = 1 * 10 ** 16; // default price is 0.01 matic

    /// @notice Sets the price for creating and updating projects
    /// @param newPrice New price for creating and updating projects
    // function setPrice(uint256 newPrice) {

    // }


    // function create(string memory name, string memory description, uint started, uint ended, string memory primaryUrl, string[] memory tags) public {

    // }
}

